import react from "react";

function App() {

  const nome = 'Cesar';

  function formatarNome(nome) {
    return nome;
  };

  const usuarios = {
    nome: 'Cesar',
    idade: 30,
    profissao: 'Desenvolvedor'
  };

  function formatarDadosUsuario(usuario) {
    return `Nome: ${usuarios.nome} tem Idade: ${usuarios.idade} anos e trabalha como ${usuarios.profissao}.`;
  }

  return (
    <div>
      <h1>Tecnology & Programming</h1>
      <p>Hello, {formatarNome(nome)} {formatarDadosUsuario()}</p>
    </div>
  );
}

export default App;
